import React from 'react';

const Navbar = () => {
  const estiloDaNavbar = {
    position: 'fixed', // Torna a barra de navegação fixa
    top: 0, // Fixa a barra de navegação no topo
    background: 'rgba(68, 23, 79, 0.49)',
    padding: '10px 20px', // Ajuste o espaçamento conforme necessário
    width: '100%', // Faz a barra de navegação ocupar toda a largura
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  };

  return (
    <div style={estiloDaNavbar}>
      <div>
        {/* Adicione seu logotipo ou título da navegação aqui */}
      </div>
      <div>
        {/* Adicione links de navegação aqui */}
      </div>
    </div>
  );
};

export default Navbar;
